INSERT INTO `catalog_pages` VALUES ('11', '9', 'Recompensas', '1', '26', '1', '1', '1', '0', '0', '2', 'recycler_prizes', 'catalog_recycler_headline3', '', '', 'What are the prizes? Ecotron box may contain one of these:', '', '', '');
INSERT INTO `catalog_pages` VALUES ('12', '9', 'Instrucciones', '1', '42', '1', '1', '1', '0', '0', '3', 'recycler_info', 'catalog_recycler_headline3', 'ctlg_ecotron_box', '', 'The Ecotron is a furni recycler. Get rid of old furni... what will you get in return? It\'s a surprise! Become a Habbo eco-warrior. No refunds!', 'How to use the Ecotron?', '1. Just drag 5 items from your hand to the Ecotron. One item / square. Recyclable items are marked in your inventory with an image. When you have 5 items in the boxes, click the \"Recycle\" button. You can now find the Ecotron prize box from your hand.\r\n\r\n2. Click the box to see its tag. Open the box, or trade it unopened. The timer shows you how long you have to wait before you can recycle more items. Check the prizes before you recycle- don\'t be surprised by the surprise!', '');
